import React from 'react';
import "../styles/TableManager.scss";
import MySelect from "./UI/MySelect";
import MyInput from "./UI/MyInput";

const TableManager = () => {
    return (
        <div className="TableManager">
            <MySelect
                data={{
                    date: "Дата",
                    title: "Название",
                    quantity: "Количество",
                    distance: "Растояние"
                }}
                title="Поле"
            />
            <MySelect
                data={{
                    equal: "Равно",
                    contains: "Содержит",
                    more: "Больше",
                    less: "Меньше"
                }}
                title="Условие"
            />
            <MyInput/>
        </div>
    );
};

export default TableManager;
